/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */


const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1 {...{
      "id": "projeto-intenet-banking"
    }}>{`Projeto Intenet Banking`}</h1>
    <blockquote>
      <p parentName="blockquote">{`Se estiver criando uma nova release do produto se atente a seo `}<em parentName="p"><a parentName="em" {...{
            "href": "#Configurando-para-novos-releases"
          }}>{`Configurando para novos releases`}</a></em>{`
Se estiver clonando o projeto para trabalhar sobre uma release j existente se atente a seo `}<em parentName="p"><a parentName="em" {...{
            "href": "#Desenvolvimento"
          }}>{`Desenvolvimento`}</a></em>{` `}</p>
    </blockquote>
    <h2 {...{
      "id": "palavras-chave"
    }}>{`Palavras-chave`}</h2>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://developer.android.com/studio/build/build-variants"
        }}>{`Flavors`}</a>{`: So tipos de compilao e so utilizados para organizar os diferentes releases. Podem ser configurados no menu (Build > Edit Flavors) no Android Studio`}</li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://developer.apple.com/library/archive/featuredarticles/XcodeConcepts/Concept*Targets.html"
        }}>{`Targets/Schemes`}</a>{`: Definem um produto a ser gerado e contem as instrues necessrias para a gerao do produto`}</li>
      <li parentName="ul"><a parentName="li" {...{
          "href": ""
        }}>{`Packager`}</a>{` O packager  o processo reponsvel por juntar os mdulos javascript/typescript em um un`}<em parentName="li">{`co arquivo denominado `}</em>{`bundle`}<em parentName="li">{`, detectar alteraes nesses arquivos e atualizar esse `}</em>{`bundle`}<em parentName="li">{`. Esse `}</em>{`bundle*  integrado ao executvel da aplicao (.apk/.ipa)`}</li>
    </ul>
    <blockquote>
      <h2 parentName="blockquote" {...{
        "id": "importante"
      }}>{`IMPORTANTE**`}</h2>
      <p parentName="blockquote">{`Quando a aplicao  executada utilizando o comando `}<inlineCode parentName="p">{`react-native run-ios --scheme="Nome do scheme"`}</inlineCode>{` ou `}<inlineCode parentName="p">{`react-native run-android --variant="Nome do flavor"`}</inlineCode>{` o `}<strong parentName="p">{`packager`}</strong>{` depende da varivel `}<em parentName="p">{`REACT_APP_COSTUMER`}</em>{` estar presente no sistema. Veja abaixo na seo `}<strong parentName="p"><em parentName="strong">{`Configurao do ambiente`}</em></strong>{` no 2 item, como definir e os valores aceitos para esta varivel.`}</p>
    </blockquote>
    <h2 {...{
      "id": "para-novos-releases"
    }}>{`Para novos `}<strong parentName="h2">{`releases`}</strong></h2>
    <p>{`Abaixo descrevem-se as etapas necessrias para configurar uma nova release do projeto`}</p>
    <h3 {...{
      "id": "react-native"
    }}>{`REACT NATIVE`}</h3>
    <p>{`Dentro de `}<a parentName="p" {...{
        "href": "src/assets/themes/"
      }}>{`src/assets/themes`}</a>{` deve ser criado uma nova pasta com o contedo da nova release.
Os arquivos necessrios para a nova release:`}</p>
    <ul>
      <li parentName="ul">{`colors.js (Com as cores do projeto)`}</li>
      <li parentName="ul">{`fonts.js (Com as fontes do projeto (Se forem adicionadas novas fontes, devem ser vinculadas no projeto nativo Android/iOS))`}</li>
      <li parentName="ul">{`images/ (As imagens utilizadas pelo projeto)`}</li>
    </ul>
    <h4 {...{
      "id": "ios"
    }}><strong parentName="h4">{`iOS`}</strong></h4>
    <ul>
      <li parentName="ul">{`Deve ser criado um novo `}<strong parentName="li">{`target`}</strong>{` para a nova release. Isso pode ser feito duplicando um target existente nas configuraes do projeto. `}</li>
      <li parentName="ul">{`Dentro da aba `}<em parentName="li">{`Build Phases`}</em>{` na fase `}<em parentName="li">{`Bundle React Native code and images`}</em>{` deve se definida aps a linha `}<em parentName="li">{`export NODE_BINARY=node`}</em>{` a linha `}<em parentName="li">{`export REACT_APP_COSTUMER="Uma das pastas configuradas no React Native"`}</em></li>
    </ul>
    <pre><code parentName="pre" {...{
        "className": "language-shell"
      }}>{`export NODE_BINARY=node
export REACT_APP_COSTUMER="Uma das pastas configuradas no React Native"
../node_modules/react-native/scripts/react-native-xcode.sh
`}</code></pre>
    <ul>
      <li parentName="ul">{`Deve ser configurado um novo scheme para buildar o target existente. Isso pode ser feito duplicando algum scheme existente.`}</li>
      <li parentName="ul">{`Os recursos de icone do aplicativo e launchscreen da nova release devem ser configurados da seguinte forma:`}</li>
      <li parentName="ul">{`Crie um novo pacote de recursos (.xcassets), e associe ao `}<em parentName="li">{`target`}</em>{` da release marcando-o na seo `}<strong parentName="li">{`Target membership`}</strong>{` (caso necessrio desmarque de targets que no esto relacionados ao produto)`}</li>
      <li parentName="ul">{`Dentro do pacote de recursos crie um novo recurso de icone (App Icons & Launch Images > New iOS App Icon) nomeado `}<em parentName="li">{`AppIcon`}</em>{` e fornea a imagens para os cones da release`}</li>
      <li parentName="ul">{`Ainda dentro do pacote de recursos crie um novo recurso de imagem (New Image Set) nomeado `}<em parentName="li">{`splash_screen`}</em>{` e fornea os arquivos de imagem da splash_screen`}</li>
    </ul>
    <h4 {...{
      "id": "android"
    }}><strong parentName="h4">{`ANDROID`}</strong></h4>
    <ul>
      <li parentName="ul">{`Deve ser criado um novo `}<strong parentName="li">{`flavor`}</strong>{` para a nova release. Pode ser definida pelo menu (Build > Edit Flavors) no Android Studio`}</li>
      <li parentName="ul">{`Dentro das configuraes do novo `}<strong parentName="li">{`flavor`}</strong>{` deve ser definida a varivel `}<em parentName="li">{`costumer`}</em>{` = "Uma das pastas configuradas no React Native" `}</li>
    </ul>
    <pre><code parentName="pre" {...{
        "className": "language-gradle"
      }}>{`//Arquivo /android/app/build.gradle
android {
  ...
  flavorDimensions 'dimension'
  productFlavors {
    flavorName {
      dimension = 'dimension'
      //Esta varivel ser usada pelo React Native para apontar para a pasta com os recursos da nova release
      costumer = 'Uma das pastas configuradas em /src/assets/themes/'
    }
  }
  ...
}
`}</code></pre>
    <h1 {...{
      "id": ""
    }}></h1>
    <h2 {...{
      "id": "configurao-para-desenvolvimento"
    }}>{`Configurao para Desenvolvimento`}</h2>
    <p>{`Abaixo esto descritos os requisitos necessrios para um melhor desenvolvimento na arquitetura descrita na seo anterior`}</p>
    <h3 {...{
      "id": "configurao-do-ambiente"
    }}>{`Configurao do ambiente`}</h3>
    <ul>
      <li parentName="ul">{`No momento da elaborao deste manual a verso das ferramentas utilizadas no desenvolvimento eram:`}<ul parentName="li">
          <li parentName="ul">{`npm: 6.4.1`}</li>
          <li parentName="ul">{`node: 10.15.3`}</li>
          <li parentName="ul">{`java: 1.8.0_211`}</li>
          <li parentName="ul">{`XCode: 10.2.1`}</li>
        </ul></li>
      <li parentName="ul">{`A varivel REACT_APP_COSTUMER deve ser definida no ambiente utilizado com o valor igual a algum dos diretrios da pasta `}<a parentName="li" {...{
          "href": "src/assets/themes"
        }}>{`src/assets/themes`}</a>{`. Isso se deve devido as variveis configuradas no `}<strong parentName="li">{`flavor`}</strong>{`/`}<strong parentName="li">{`target`}</strong>{` no serem definidas na sesso do `}<strong parentName="li">{`packager`}</strong>{` iniciado pelo comando `}<em parentName="li">{`react-native run-android`}</em>{`/`}<em parentName="li">{`react-native run-ios`}</em></li>
    </ul>
    <h3 {...{
      "id": "executando-a-aplicao"
    }}>{`Executando a aplicao`}</h3>
    <ul>
      <li parentName="ul">{`Para iniciar o aplicativo deve ser utilizado o seguinte comando:`}</li>
    </ul>
    <h4 {...{
      "id": "android-1"
    }}>{`Android`}</h4>
    <ul>
      <li parentName="ul"><strong parentName="li">{`A varivel REACT_APP_COSTUMER deve estar definida para que o packager do React Native possa apontar para os recursos da release`}</strong></li>
    </ul>
    <pre><code parentName="pre" {...{
        "className": "language-console"
      }}>{`# Esse comando  opcional e s  necessrio quando a varivel REACT_APP_COSTUMER foi definida dentro da sesso do terminal
react-native start 
react-native run-android --variant="O nome do flavor da release"Debug
`}</code></pre>
    <h4 {...{
      "id": "ios-1"
    }}>{`iOS`}</h4>
    <ul>
      <li parentName="ul"><strong parentName="li">{`A varivel REACT_APP_COSTUMER deve estar definida para que o packager do React Native possa apontar para os recursos especficos da release`}</strong></li>
    </ul>
    <pre><code parentName="pre" {...{}}>{`# Esse comando  opcional e s  necessrio quando a varivel REACT_APP_COSTUMER foi definida dentro da sesso do terminal
react-native start 
react-native run-ios --scheme="O nome do scheme da release"
`}</code></pre>
    <h3 {...{
      "id": "gerando-a-release"
    }}>{`Gerando a release`}</h3>
    <p>{`Para gerar uma verso de publicao da release, deve ser executado o seguinte processo para cada uma das plataformas:`}</p>
    <h4 {...{
      "id": "android-2"
    }}>{`Android`}</h4>
    <pre><code parentName="pre" {...{
        "className": "language-console"
      }}>{`cd android
.\\gradlew clean
.\\gradlew assemble(O nome do flavor)Release
`}</code></pre>
    <p>{`Aps concludo o processo a APK para publicao estar disponvel na pasta `}<a parentName="p" {...{
        "href": "android/app/build/outputs/release/"
      }}>{`android/app/build/outputs/release/O nome do flavor/arquivo.apk`}</a></p>
    <h4 {...{
      "id": "ios-2"
    }}>{`iOS`}</h4>
    <p>{`Selecione o scheme da release especifica, selecione o dispositivo `}<em parentName="p">{`Generic iOS Device`}</em>{` e selecione a opo (Product > Archive). Vale lembrar que para executar o archive deve ser utilizado um perfil de desenvolvedor na App Store`}</p>
    <h2 {...{
      "id": "erros-comuns"
    }}>{`Erros comuns`}</h2>
    <h3 {...{
      "id": "android-3"
    }}>{`Android`}</h3>
    <h3 {...{
      "id": "android-erro-ao-compilar-o-lottie-react-native-nullpointerexception"
    }}>{`(Android) Erro ao compilar o lottie-react-native NullPointerException`}</h3>
    <ul>
      <li parentName="ul">{`A verso do java utilizada pela equipe de desenvolvimento  a 1.8.0_211 verses mais recentes ou mais antigas no foram testadas e por isso podem no funcionar com a verso atual da aplicao.`}</li>
    </ul>
    <h3 {...{
      "id": "android-algum-erro-ao-gerar-a-release-ou-executar-a-aplicao"
    }}>{`(Android) Algum erro ao gerar a release ou executar a aplicao`}</h3>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`As vezes o Instant Run pode interferir na gerao do APK, devido a isso recomenda-se desabilitar o Instant Run no Android Studio`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Quando o projeto  aberto pela primeira vez, o Android Studio oferece a opo de atualizar o Gradle. Essa alterao na verso do gradle ainda no funciona com a verso de algumas bibliotecas usadas no projeto, logo a atualizao pode quebrar o build no Android. No momento de elaborao deste manual, a verso utilizada  a `}<em parentName="p">{`4.4-all`}</em>{` no arquivo `}<a parentName="p" {...{
            "href": "android/gradle/wrapper/gradle-wrapper.properties"
          }}>{`gradle-wrapper.properties`}</a></p>
      </li>
    </ul>
    <pre><code parentName="pre" {...{
        "className": "language-ini"
      }}>{`...
distributionUrl=https\\://services.gradle.org/distributions/gradle-4.4-all.zip
`}</code></pre>
    <h3 {...{
      "id": "ios-algum-erro-ao-gerar-a-release-ou-executar-a-aplicao"
    }}>{`(iOS) Algum erro ao gerar a release ou executar a aplicao`}</h3>
    <ul>
      <li parentName="ul">{`Erro ao gerar a release ou executar a aplicao.
`}<inlineCode parentName="li">{`'React/RCT*.h' file not found`}</inlineCode>{` Certifique-se de que dentro do `}<strong parentName="li">{`scheme`}</strong>{` da release o `}<strong parentName="li">{`target`}</strong>{` do React esta definido e o build paralelo desabilitado, j que a release depende do `}<strong parentName="li">{`target`}</strong>{` do React`}</li>
    </ul>
    <h3 {...{
      "id": "aps-alterar-o-arquivo-babelrcjs-ou-o-valor-de-react_app_costumer-o-aplicativo-obtm-os-arquivos-do-valor-anterior"
    }}>{`Aps alterar o arquivo .babelrc.js ou o valor de REACT_APP_COSTUMER o aplicativo obtm os arquivos do valor anterior`}</h3>
    <ul>
      <li parentName="ul">{`O packager mantm uma verso em cache do arquivo `}<a parentName="li" {...{
          "href": ".babelrc.js"
        }}>{`.babelrc.js`}</a>{`. Dessa forma uma alterao do arquivo ou da varivel pode no se refletir de maneira imediata. Para que o packager utilize a nova verso do arquivo ou variavel  necessrio utilizar o comando.`}</li>
    </ul>
    <pre><code parentName="pre" {...{}}>{`react-native start --reset-cache
`}</code></pre>
    <h2 {...{
      "id": "sugestes"
    }}>{`Sugestes`}</h2>
    <h3 {...{
      "id": "para-gerenciar-as-verses-do-nodejs-e-npm"
    }}>{`Para gerenciar as verses do NodeJS e npm`}</h3>
    <ul>
      <li parentName="ul">
        <p parentName="li"><a parentName="p" {...{
            "href": "https://github.com/nvm-sh/nvm"
          }}>{`nvm`}</a>{`: O `}<em parentName="p">{`nvm`}</em>{`  um conjunto de comandos que sao instalados no ambiente e permitem gerenciar de maneira facil diversas verses do `}<em parentName="p">{`NodeJS & npm`}</em></p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Para gerenciar a execuo de diversas releases do projeto podem ser criados scripts com os comandos dentro do arquivo `}<a parentName="p" {...{
            "href": "package.json"
          }}>{`package.json`}</a>{` e depois execut-lo com `}<inlineCode parentName="p">{`npm run nome_do_script`}</inlineCode></p>
      </li>
    </ul>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
